import React from 'react';
import './About.css';

function About() {
  return (
    <div className="grid-item about-me">
      <h2>About Me</h2>
      <div className="row">
        <div className="image">
          <img src="path_to_your_image.jpg" alt="Profile" />
        </div>
        <div className="content">
          <div className="box-container">
            <div className="box">
              <p><span>Name:</span> John Doe</p>
            </div>
            <div className="box">
              <p><span>Profession:</span> Web Developer</p>
            </div>
            {/* More information boxes */}
          </div>
          <div className="resumebtn">
            <button className="btn">Download Resume</button>
          </div>
        </div>
      </div>
    </div>
  );
}

export default About;
